        var draw3DBarGraph = function(yData,data,index) {

            var dom = document.getElementById("container");
            var myChart = echarts.init(dom);

                tooltip: {show: true // 必须引入 tooltip 组件

                    type: 'bar3D',

                        return {
                            value: [item[0], item[1], item[2]],

                            fontSize: 16,

                        color: '#900',

                            }
                        },

                            color: '#900'
                        }

                    animation: true,
                }]

        };
